import './App.css';
import { useState } from 'react';
import Searchbar from './components/Searchbar';

function App() {
  const [teams, setTeams] = useState([]);

  const fetchTeams = (id) => {
    fetch(`/leagues/${id}`)
        .then(res => res.json())
        .then(data => setTeams(data));
  }

  // const fetchTeam = (id) => {
  //   fetch(`/team/${id}`)
  //       .then(res => res.json())
  //       .then(data => setTeams(data));
  // }

  const realMadrid = () => {
    fetch('/real')
    .then(res => res.json())
    .then(data => setTeams(data))
  };

  return (
    <section className='app'>
      <Searchbar 
        fetchTeams={fetchTeams}
        teams={teams}
      />
    </section>
  );
}

export default App;
